Тёлки просто без ума от быков (есчебы, у быков же такие инструменты...), они готовы отдаться им с патрахами только исза того что мужики овны делают из себя хуй знает что, тоесть джентельменов, и делают вид какбутто хорошо стоят на ногах, при этом не падают только потому что хуй зацепился за карниз... Хоть он и не столь бурен в траханье но тёлки при виде него чуть не коньчают. Он позволит в сексе делать с собой всё что угодно, но и от партнёрши он требует разных извращений, уш миньета сто пудово ему захочецца. Бык на столько сука умный, что его хуй поймаешь на женские уловки типо там, "Ой, я боюсь одна вазвращаться домой" ХУЙ, его на это не возьмешь. Если вы страхопиздеще, то даже и не пытайтесь завоевать быка, запомните, ему на вас ПОХУЙ! Брак быка сука долгий... и счастливый... Ну как тут не будешь счастливым если тебе каждый день делают миньет!!!
